import React from 'react';
import { useAuth } from '../context/AuthContext';
import Footer from '../components/Footer';

// Dog images
import dog1 from '../assets/pexels-chevanon-1108099.jpg';
import dog2 from '../assets/pexels-kateryna-babaieva-1423213-2853422.jpg';
import dog3 from '../assets/pexels-shvetsa-4587962.jpg';

// Cat images
import cat1 from '../assets/pexels-pixabay-45170.jpg';
import cat2 from '../assets/pexels-larissa-barbosa-945746-1870376.jpg';
import cat3 from '../assets/pexels-wojciech-kumpicki-1084687-2071873.jpg';

export default function Dashboard() {
  const { user } = useAuth();

  const pets = [
    { src: dog1, name: 'Buddy', desc: 'Loyal and full of energy!' },
    { src: dog2, name: 'Max', desc: 'Snow is his playground!' },
    { src: dog3, name: 'Luna', desc: 'Curious and playful pup.' },
    { src: cat1, name: 'Whiskers', desc: 'Charming and loves naps.' },
    { src: cat2, name: 'Mittens', desc: 'Elegant and always watching.' },
    { src: cat3, name: 'Leo', desc: 'Always on an adventure!' }
  ];

  return (
    <div className="flex flex-col min-h-screen bg-gradient-to-br from-rose-50 to-blue-100">
      <div className="flex-grow p-6">
        <h1 className="text-4xl font-extrabold mb-4 text-center text-rose-600">üêæ Welcome to Pet Clinic</h1>
        <p className="text-center text-lg text-gray-700 mb-8">
          Logged in as: <strong className="capitalize">{user?.role}</strong>
        </p>

        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-6 px-4 md:px-12">
          {pets.map((pet, idx) => (
            <div
              key={idx}
              className="bg-white rounded-xl shadow-lg overflow-hidden transform hover:scale-105 transition-all duration-300 hover:shadow-xl"
            >
              <img src={pet.src} alt={pet.name} className="h-52 w-full object-cover" />
              <div className="p-4">
                <h3 className="text-xl font-bold text-gray-800">{pet.name}</h3>
                <p className="text-gray-600">{pet.desc}</p>
              </div>
            </div>
          ))}
        </div>
      </div>

      <Footer />
    </div>
  );
}
